import React from "react";
import {
    Col,
    FormGroup,
    Label,
    Button,
    ModalBody,
    ModalFooter,
    Modal,
    ModalHeader, Input
} from "reactstrap";
import Translate from "../../../Translate";
import {Plus, Trash2} from "react-feather";

const SuplliersAddModal = props => {

    const printBankElement = () => {
        let element = [];
        let length = 1;
        for (let i = 0; i < length; i++) {
            element.push(
                <FormGroup row key={i}>
                    <Label for={'bank'} sm={3}>
                        {
                            i === 0 ?
                                <Translate name={'bank'}/>
                                :
                                ''
                        }
                    </Label>
                    <Col sm={3} className={'pr-0'}>
                        <Input
                            type={'select'}
                            value={''}
                            className={'square'}
                        >
                            <option value={''}>
                                Banks
                            </option>
                        </Input>
                    </Col>
                </FormGroup>
            )
        }

        return element
    }

    return (
        <Modal isOpen={true} size='lg'>
            <ModalHeader>
                <Translate name={'addSupplier'}/>
            </ModalHeader>
            <ModalBody>
                <form>

                    <FormGroup row>
                        <Label for={'firstName'} sm={3}>
                            <Translate name={'name'} />
                        </Label>
                        <Col sm={7} className={'pr-0'}>
                            <input
                                id={'firstName'}
                                type={'text'}
                                value={''}
                                className={`form-control square`}
                            />
                        </Col>
                        <Col sm={2} className={'pl-0'}>
                            <Input
                                className={'square border-left-0'}
                                type={'select'}
                                value={''}
                            >
                                <option value={1}>ՍՊԸ</option>
                                <option value={2}>ՓԲԸ</option>
                                <option value={3}>ԲԲԸ</option>
                                <option value={4}>ԱՁ</option>
                            </Input>
                        </Col>
                    </FormGroup>

                    <FormGroup row>
                        <Label for={'hh'} sm={3}>
                            <Translate name={'hh'} />
                        </Label>
                        <Col sm={9}>
                            <input
                                id={'hh'}
                                type={'text'}
                                value={''}
                                className={`form-control square`}
                            />
                        </Col>
                    </FormGroup>

                    <FormGroup row>
                        <Label for={'hvhh'} sm={3}>
                            <Translate name={'hvhh'} />
                        </Label>
                        <Col sm={9}>
                            <input
                                id={'hvhh'}
                                type={'text'}
                                value={''}
                                className={`form-control square`}
                            />
                        </Col>
                    </FormGroup>

                    <FormGroup row>
                        <Label for={'address'} sm={3}>
                            <Translate name={'address'} />
                        </Label>
                        <Col sm={9}>
                            <input
                                id={'address'}
                                type={'text'}
                                value={''}
                                className={`form-control square`}
                            />
                        </Col>
                    </FormGroup>

                    {printBankElement()}

                </form>
            </ModalBody>
            <ModalFooter>
                <Button color="primary" className="btn-square" outline type="submit">
                    <Translate name={'confirm'} />
                </Button>
            </ModalFooter>
        </Modal>
    )
}

export default SuplliersAddModal;
